import React, { useState, useEffect } from "react";
import { connect } from "react-redux";

import "./Database.css"
import { getDatabaseList } from "./Redux/actions"
import { useAuth0 } from "../../App/react-auth0-spa";

interface DatabaseProps {
    databaseList: any[];
    dispatchDatabaseList: any;
}

function Database(props: DatabaseProps): React.ReactElement {
    // const [databaseList, setList] = useState([]);
    const { getTokenSilently } = useAuth0();
    const [token, setToken] = useState();
    const [refreshRequired, setRefreshRequired] = useState(true);

    useEffect(() => {
        const fetchDatabaseList = async () => {
            if (refreshRequired) {
                const newToken = await getTokenSilently();
                setToken(newToken);
                await props.dispatchDatabaseList(newToken)
                setRefreshRequired(false);
            }
        };
        fetchDatabaseList();
    }, []);

    const getTable = (tableName: string) => {

    }

    const generateList = () => {
        console.log('dataBaseLIst inside generateList', props.databaseList)

        return props.databaseList.map((table: string) => {
            return (
                <div
                    key={table}
                    className="tableName"
                // onClick={getTable}
                >{table}</div>
            )
        })
    }

    return (
        <div
            className="container"
        >
            {generateList()}
        </div>
    )
}

const mapStateToProps = (state: any) => {
    return {
        databaseList: state.database.databaseList
    }
}

const mapDispatchToProps = (dispatch: any) => {
    return {
        dispatchDatabaseList: (token: string) => dispatch(getDatabaseList(token))
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Database);
